import React from 'react'
import './AdminDisplay.css'
import { useState } from 'react'
export default function AdminDisplay() {
const[decline,setdecline] = useState('');
const declinesetter = (itemIndex)=>{
  const updatedItems = [...decline];
    updatedItems.splice(itemIndex, 1);
    setdecline(updatedItems);
}
const foodItems = [
  
  { name: 'Item 1', mfg_exp: '12/2023', location: 'Pantry 1' },
  { name: 'Item 2', mfg_exp: '01/2024', location: 'Pantry 2' },
  { name: 'Item 3', mfg_exp: '06/2024', location: 'Pantry 3' },
  { name: 'Item 4', mfg_exp: '07/2024', location: 'Pantry 4' },
  { name: 'Item 5', mfg_exp: '12/2024', location: 'Pantry 5' },
  { name: 'Item 6', mfg_exp: '03/2024', location: 'Pantry 6' },
  { name: 'Item 7', mfg_exp: '01/2024', location: 'Pantry 7' },
  
];
  return (
    <div>
      {decline.splice(0,7).map((foodItems,index)=>(<div className='output'>
        <div className='list'><h1>Food item</h1></div>
        <div className='list'><h1>MFG_EXP</h1></div>
        <div className='list'><h1>Location</h1></div>
        <button class="button-68" role="button" style={{ backgroundColor: '#C20114' }}>Decline</button>
        <button onClick={declinesetter(index)} class="button-68" role="button" style={{ backgroundColor: '#4DA167' }}>Accept</button>
      </div>))}
    </div>
  )
}
